import React, { Component } from "react";

class Sign extends Component {
  constructor() {
    super();
    this.state = { isRegister: false };
  }
  toggleRegister = (state) => () => this.setState({ isRegister: state });
  render() {
    return (
      <div class="container">
      <div class="row">
        <div class="col">
          Column
        </div>
        <div class="col">
          Column
        </div>
        <div class="col">
          Column
        </div>
      </div>
    </div>
    );
  }
}

export default Sign;
